// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract Points {
    uint public total;
    function addPoints(uint _point) public {
        total += _point;
    }
}

contract Points2 {
    uint public total;
    function addPoints(uint _point) public {
        total += _point*2;
    }
}

contract UserInfo {
    uint public total;

    function pointupWithDeligateCall(address _address, uint _point) public {
        (bool success,) = _address.call(
            abi.encodeWithSignature("addPoints(uint256)", _point)
        );
        require(success, "Failed");
    }
}

